class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """

        chars = set()
        max_len = 0
        for i in range(len(s)):
            chars.clear()

            for j in range(i, len(s)):
                char_right = s[j]
                if char_right in chars:
                    break

                chars.add(char_right)

                substring_len = j - i + 1
                max_len = max(max_len, substring_len)

        return max_len


